import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-responsive-popover", tags, suffix)} class="${classMap(context.classes.popover)}" hide-arrow content-only-on-desktop _disable-initial-focus placement-type="Bottom" horizontal-align="Stretch" @ui5-after-open=${ifDefined(context._afterOpenPopover)} @ui5-after-close=${ifDefined(context._afterClosePopover)}><${scopeTag("ui5-busy-indicator", tags, suffix)} ?active=${context.loading} size="Medium" class="ui5-combobox-busy"></${scopeTag("ui5-busy-indicator", tags, suffix)}><div slot="header" class="ui5-responsive-popover-header"><div class="row"><span>${ifDefined(context._headerTitleText)}</span><${scopeTag("ui5-button", tags, suffix)} class="ui5-responsive-popover-close-btn" icon="decline" design="Transparent" @click="${context._closeRespPopover}"></${scopeTag("ui5-button", tags, suffix)}></div><div class="row"><div class="input-root-phone" value-state="${ifDefined(context.valueState)}"><input class="ui5-input-inner-phone" .value="${ifDefined(context.value)}" inner-input placeholder="${ifDefined(context.placeholder)}" value-state="${ifDefined(context.valueState)}" @input="${context._input}" @change="${context._inputChange}" @keydown="${context._keydown}" aria-autocomplete="both" /></div></div>${ context.hasValueStateText ? block1(context, tags, suffix) : undefined }</div>${ !context._isPhone ? block5(context, tags, suffix) : undefined }<${scopeTag("ui5-list", tags, suffix)} separators="None" @ui5-item-click=${ifDefined(context._selectItem)} @ui5-item-focused=${ifDefined(context._onItemFocus)} @mousedown=${context._itemMousedown} mode="SingleSelect">${ repeat(context._filteredItems, (item, index) => item._id || index, (item, index) => block10(item, index, context, tags, suffix)) }</${scopeTag("ui5-list", tags, suffix)}><div slot="footer" class="ui5-responsive-popover-footer"><${scopeTag("ui5-button", tags, suffix)} design="Transparent" @click="${context._closeRespPopover}">OK</${scopeTag("ui5-button", tags, suffix)}></div></${scopeTag("ui5-responsive-popover", tags, suffix)}>${ context.shouldOpenValueStateMessagePopover ? block13(context, tags, suffix) : undefined }`;
