const block5 = (context, tags, suffix) => html`${ context.hasValueStateText ? block6(context, tags, suffix) : undefined }`;
const block6 = (context, tags, suffix) => html`<div class="ui5-responsive-popover-header ${classMap(context.classes.popoverValueState)}" ?focused=${context._isValueStateFocused} tabindex="0" style="${styleMap(context.styles.suggestionPopoverHeader)}"><${scopeTag("ui5-icon", tags, suffix)} class="ui5-input-value-state-message-icon" name="${ifDefined(context._valueStateMessageIcon)}"></${scopeTag("ui5-icon", tags, suffix)}>${ context.shouldDisplayDefaultValueStateMessage ? block7(context, tags, suffix) : block8(context, tags, suffix) }</div>`;
const block7 = (context, tags, suffix) => html`${ifDefined(context.valueStateText)}`;
const block8 = (context, tags, suffix) => html`${ repeat(context.valueStateMessageText, (item, index) => item._id || index, (item, index) => block9(item, index, context, tags, suffix)) }`;
const block9 = (item, index, context, tags, suffix) => html`${ifDefined(item)}`;
const block10 = (item, index, context, tags, suffix) => html`${ item.isGroupItem ? block11(item, index, context, tags, suffix) : block12(item, index, context, tags, suffix) }`;
const block11 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li-groupheader", tags, suffix)} ?focused=${item.focused}>${ifDefined(item.text)}</${scopeTag("ui5-li-groupheader", tags, suffix)}>`;
const block12 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-li", tags, suffix)} type="Active" additional-text=${ifDefined(item.additionalText)} group-name=${ifDefined(item.groupName)} ._tabIndex=${ifDefined(item.itemTabIndex)} .mappedItem=${ifDefined(item)} ?selected=${item.selected} ?focused=${item.focused}>${ifDefined(item.text)}</${scopeTag("ui5-li", tags, suffix)}>`;
